@merrimanswaimea is worth the drive while you’re on the Big Island! It’s a beautiful little place that’s unassuming with some of the best food you’ll find! 

There is a set Prix Fixe menu for dinner that includes a starter, entree and dessert. I accompanied mine with a delicious glass of Pinot Gris from Oregon. 

